INSERT INTO `ea_settings` VALUES (1,'company_working_plan','{\"sunday\":null,\"monday\":{\"start\":\"09:00\",\"end\":\"19:00\",\"breaks\":[{\"start\":\"14:00\",\"end\":\"16:00\"}]},\"tuesday\":{\"start\":\"09:00\",\"end\":\"13:00\",\"breaks\":[]},\"wednesday\":{\"start\":\"09:00\",\"end\":\"13:00\",\"breaks\":[]},\"thursday\":{\"start\":\"09:00\",\"end\":\"13:00\",\"breaks\":[]},\"friday\":{\"start\":\"09:00\",\"end\":\"19:00\",\"breaks\":[]},\"saturday\":null}'),(2,'book_advance_timeout','0'),(3,'google_analytics_code',''),(4,'customer_notifications','1'),(5,'date_format','DMY'),(6,'time_format','military'),(7,'require_captcha','1'),(8,'display_cookie_notice','1'),(9,'cookie_notice_content','<p>Utilizamos cookies propias y de terceros para obtener datos estadísticos\n de la navegación de nuestros usuarios y mejorar nuestros servicios. Si \nacepta o continúa navegando, consideramos que acepta su uso. Puede obtener más información en <strong>el enlace a los Términos y condiciones de las siguientes páginas</strong>.</p>'),(10,'display_terms_and_conditions','1'),(11,'terms_and_conditions_content','<p>AVISO LEGAL Y CONDICIONES GENERALES DE USO DEL Sitio Web</p><p>decitas.zafarraya.es - Cita previa Guadalinfo</p><p>I. INFORMACIÓN GENERAL</p><p>En\n cumplimiento con el deber de información dispuesto en la Ley 34/2002 de\n Servicios de la Sociedad de la Información y el Comercio Electrónico \n(LSSI-CE) de 11 de julio, se facilitan a continuación los siguientes \ndatos de información general de este sitio web:</p><p>La titularidad de \neste sitio web, https://decitas.zafarraya.es, (en adelante, Sitio Web) \nla ostenta: AYUNTAMIENTO DE ZAFARRAYA, provista de NIF: P1819600F, cuyo \nrepresentante es: Dª Rosana Molina Molina, y cuyos datos de contacto \nson:</p><p>Dirección:</p><p>C/ Entrada de Granada, 5</p><p>18128 Zafarraya</p><p>GRANADA</p><p>Teléfono de contacto: 958362560</p><p>Email de contacto: informatica@zafarraya.es</p><p>II. TÉRMINOS Y CONDICIONES GENERALES DE USO</p><p>El objeto de las condiciones: El Sitio Web</p><p>El\n objeto de las presentes Condiciones Generales de Uso (en adelante, \nCondiciones) es regular el acceso y la utilización del Sitio Web. A los \nefectos de las presentes Condiciones se entenderá como Sitio Web: la \napariencia externa de los interfaces de pantalla, tanto de forma \nestática como de forma dinámica, es decir, el árbol de navegación; y \ntodos los elementos integrados tanto en los interfaces de pantalla como \nen el árbol de navegación (en adelante, Contenidos) y todos aquellos \nservicios o recursos en línea que en su caso ofrezca a los Usuarios (en \nadelante, Servicios).</p><p>Cita previa Guadalinfo se reserva la \nfacultad de modificar, en cualquier momento, y sin aviso previo, la \npresentación y configuración del Sitio Web y de los Contenidos y \nServicios que en él pudieran estar incorporados. El Usuario reconoce y \nacepta que en cualquier momento Cita previa Guadalinfo pueda \ninterrumpir, desactivar y/o cancelar cualquiera de estos elementos que \nse integran en el Sitio Web o el acceso a los mismos.</p><p>El acceso al\n Sitio Web por el Usuario tiene carácter libre y, por regla general, es \ngratuito sin que el Usuario tenga que proporcionar una contraprestación \npara poder disfrutar de ello, salvo en lo relativo al coste de conexión a\n través de la red de telecomunicaciones suministrada por el proveedor de\n acceso que hubiere contratado el Usuario.</p><p>La utilización de \nalguno de los Contenidos o Servicios del Sitio Web podrá hacerse \nmediante la suscripción o registro previo del Usuario.</p><p>El Usuario</p><p>El\n acceso, la navegación y uso del Sitio Web, confiere la condición de \nUsuario, por lo que se aceptan, desde que se inicia la navegación por el\n Sitio Web, todas las Condiciones aquí establecidas, así como sus \nulteriores modificaciones, sin perjuicio de la aplicación de la \ncorrespondiente normativa legal de obligado cumplimiento según el caso. \nDada la relevancia de lo anterior, se recomienda al Usuario leerlas cada\n vez que visite el Sitio Web.</p><p>El Sitio Web de Cita previa \nGuadalinfo proporciona gran diversidad de información, servicios y \ndatos. El Usuario asume su responsabilidad para realizar un uso correcto\n del Sitio Web. Esta responsabilidad se extenderá a:</p><p>Un uso de la \ninformación, Contenidos y/o Servicios y datos ofrecidos por Cita previa \nGuadalinfo sin que sea contrario a lo dispuesto por las presentes \nCondiciones, la Ley, la moral o el orden público, o que de cualquier \notro modo puedan suponer lesión de los derechos de terceros o del mismo \nfuncionamiento del Sitio Web.</p><p>La veracidad y licitud de las \ninformaciones aportadas por el Usuario en los formularios extendidos por\n Cita previa Guadalinfo para el acceso a ciertos Contenidos o Servicios \nofrecidos por el Sitio Web. En todo caso, el Usuario notificará de forma\n inmediata a Cita previa Guadalinfo acerca de cualquier hecho que \npermita el uso indebido de la información registrada en dichos \nformularios, tales como, pero no sólo, el robo, extravío, o el acceso no\n autorizado a identificadores y/o contraseñas, con el fin de proceder a \nsu inmediata cancelación.</p><p>El mero acceso a este Sitio Web no \nsupone entablar ningún tipo de relación de carácter comercial entre Cita\n previa Guadalinfo y el Usuario.</p><p>El Usuario declara ser mayor de \nedad y disponer de la capacidad jurídica suficiente para vincularse por \nlas presentes Condiciones. Por lo tanto, este Sitio Web de Cita previa \nGuadalinfo no se dirige a menores de edad. Cita previa Guadalinfo \ndeclina cualquier responsabilidad por el incumplimiento de este \nrequisito.</p><p>El Sitio Web está dirigido principalmente a Usuarios \nresidentes en España. Cita previa Guadalinfo no asegura que el Sitio Web\n cumpla con legislaciones de otros países, ya sea total o parcialmente. \nSi el Usuario reside o tiene su domicilio en otro lugar y decide acceder\n y/o navegar en el Sitio Web lo hará bajo su propia responsabilidad, \ndeberá asegurarse de que tal acceso y navegación cumple con la \nlegislación local que le es aplicable, no asumiendo Cita previa \nGuadalinfo responsabilidad alguna que se pueda derivar de dicho acceso.</p><p>III. ACCESO Y NAVEGACIÓN EN EL SITIOWEB: EXCLUSIÓN DE GARANTÍAS Y RESPONSABILIDAD</p><p>Cita\n previa Guadalinfo no garantiza la continuidad, disponibilidad y \nutilidad del Sitio Web, ni de los Contenidos o Servicios. Cita previa \nGuadalinfo hará todo lo posible por el buen funcionamiento del Sitio \nWeb, sin embargo, no se responsabiliza ni garantiza que el acceso a este\n Sitio Web no vaya a ser ininterrumpido o que esté libre de error.</p><p>Tampoco\n se responsabiliza o garantiza que el contenido o software al que pueda \naccederse a través de este Sitio Web, esté libre de error o cause un \ndaño al sistema informático (software y hardware) del Usuario. En ningún\n caso Cita previa Guadalinfo será responsable por las pérdidas, daños o \nperjuicios de cualquier tipo que surjan por el acceso, navegación y el \nuso del Sitio Web, incluyéndose, pero no limitándose, a los ocasionados a\n los sistemas informáticos o los provocados por la introducción de \nvirus.</p><p>Cita previa Guadalinfo tampoco se hace responsable de los \ndaños que pudiesen ocasionarse a los usuarios por un uso inadecuado de \neste Sitio Web. En particular, no se hace responsable en modo alguno de \nlas caídas, interrupciones, falta o defecto de las telecomunicaciones \nque pudieran ocurrir.</p><p>IV. POLÍTICA DE PRIVACIDAD Y PROTECCIÓN DE DATOS</p><p>Cita\n previa Guadalinfo se compromete a adoptar las medidas técnicas y \norganizativas necesarias, según el nivel de seguridad adecuado al riesgo\n de los datos recogidos.</p><p>Leyes que incorpora esta política de privacidad</p><p>Esta\n política de privacidad está adaptada a la normativa española y europea \nvigente en materia de protección de datos personales en internet. En \nconcreto, la misma respeta las siguientes normas:</p><p>El Reglamento \n(UE) 2016/679 del Parlamento Europeo y del Consejo, de 27 de abril de \n2016, relativo a la protección de las personas físicas en lo que \nrespecta al tratamiento de datos personales y a la libre circulación de \nestos datos (RGPD).</p><p>La Ley Orgánica 3/2018, de 5 de diciembre, de Protección de Datos Personales y garantía de los derechos digitales (LOPD-GDD).</p><p>El\n Real Decreto 1720/2007, de 21 de diciembre, por el que se aprueba el \nReglamento de desarrollo de la Ley Orgánica 15/1999, de 13 de diciembre,\n de Protección de Datos de Carácter Personal (RDLOPD).</p><p>La Ley 34/2002, de 11 de julio, de Servicios de la Sociedad de la Información y de Comercio Electrónico (LSSI-CE).</p><p>Identidad del responsable del tratamiento de los datos personales</p><p>El\n responsable del tratamiento de los datos personales recogidos en Cita \nprevia Guadalinfo es: AYUNTAMIENTO DE ZAFARRAYA, provista de NIF: \nP1819600F , cuyo representante es: Rosana Molina Molina (en adelante, \ntambién Responsable del tratamiento). Sus datos de contacto son los \nsiguientes:</p><p>Dirección:</p><p>C/ Entrada de Granada, 5</p><p>18128 Zafarraya</p><p>GRANADA</p><p>Teléfono de contacto: 958362560</p><p>Email de contacto: informatica@zafarraya.es</p><p>Delegado de Protección de Datos (DPD)</p><p>El\n Delegado de Protección de Datos (DPD, o DPO por sus siglas en inglés) \nes el encargado de velar por el cumplimiento de la normativa de \nprotección de datos a la cual se encuentra sujeta Cita previa \nGuadalinfo. El Usuario puede contactar con el DPD designado por el \nResponsable del tratamiento utilizando los siguientes datos de contacto:\n informatica@zafarraya.es.</p><p>Registro de Datos de Carácter Personal</p><p>En\n cumplimiento de lo establecido en el RGPD y la LOPD-GDD, le informamos \nque los datos personales recabados por Cita previa Guadalinfo mediante \nlos formularios extendidos en sus páginas quedarán incorporados y serán \ntratados en nuestro ficheros con el fin de poder facilitar, agilizar y \ncumplir los compromisos establecidos entre Cita previa Guadalinfo y el \nUsuario o el mantenimiento de la relación que se establezca en los \nformularios que este rellene, o para atender una solicitud o consulta \ndel mismo. Asimismo, de conformidad con lo previsto en el RGPD y la \nLOPD-GDD, salvo que sea de aplicación la excepción prevista en el \nartículo 30.5 del RGPD, se mantiene un registro de actividades de \ntratamiento que especifica, según sus finalidades, las actividades de \ntratamiento llevadas a cabo y las demás circunstancias establecidas en \nel RGPD.</p><p>Principios aplicables al tratamiento de los datos personales</p><p>El tratamiento de los datos personales del Usuario se someterá a los siguientes principios recogidos en el artículo 5 del RGPD:</p><p>Principio\n de licitud, lealtad y transparencia: se requerirá en todo momento el \nconsentimiento del Usuario previa información completamente transparente\n de los fines para los cuales se recogen los datos personales.</p><p>Principio de limitación de la finalidad: los datos personales serán recogidos con fines determinados, explícitos y legítimos.</p><p>Principio\n de minimización de datos: los datos personales recogidos serán \núnicamente los estrictamente necesarios en relación con los fines para \nlos que son tratados.</p><p>Principio de exactitud: los datos personales deben ser exactos y estar siempre actualizados.</p><p>Principio\n de limitación del plazo de conservación: los datos personales solo \nserán mantenidos de forma que se permita la identificación del Usuario \ndurante el tiempo necesario para los fines de su tratamiento.</p><p>Principio\n de integridad y confidencialidad: los datos personales serán tratados \nde manera que se garantice su seguridad y confidencialidad.</p><p>Principio\n de responsabilidad proactiva: el Responsable del tratamiento será \nresponsable de asegurar que los principios anteriores se cumplen.</p><p>Categorías de datos personales</p><p>Las\n categorías de datos que se tratan en Cita previa Guadalinfo son \núnicamente datos identificativos. En ningún caso, se tratan categorías \nespeciales de datos personales en el sentido del artículo 9 del RGPD.</p><p>Base legal para el tratamiento de los datos personales</p><p>La\n base legal para el tratamiento de los datos personales es el \nconsentimiento. Cita previa Guadalinfo se compromete a recabar el \nconsentimiento expreso y verificable del Usuario para el tratamiento de \nsus datos personales para uno o varios fines específicos.</p><p>El \nUsuario tendrá derecho a retirar su consentimiento en cualquier momento.\n Será tan fácil retirar el consentimiento como darlo. Como regla \ngeneral, la retirada del consentimiento no condicionará el uso del Sitio\n Web.</p><p>En las ocasiones en las que el Usuario deba o pueda \nfacilitar sus datos a través de formularios para realizar consultas, \nsolicitar información o por motivos relacionados con el contenido del \nSitio Web, se le informará en caso de que la cumplimentación de alguno \nde ellos sea obligatoria debido a que los mismos sean imprescindibles \npara el correcto desarrollo de la operación realizada.</p><p>Fines del tratamiento a que se destinan los datos personales</p><p>Los\n datos personales son recabados y gestionados por Cita previa Guadalinfo\n con la finalidad de poder facilitar, agilizar y cumplir los compromisos\n establecidos entre el Sitio Web y el Usuario o el mantenimiento de la \nrelación que se establezca en los formularios que este último rellene o \npara atender una solicitud o consulta.</p><p>Igualmente, los datos \npodrán ser utilizados con una finalidad comercial de personalización, \noperativa y estadística, y actividades propias del objeto social de Cita\n previa Guadalinfo, así como para la extracción, almacenamiento de datos\n y estudios de marketing para adecuar el Contenido ofertado al Usuario, \nasí como mejorar la calidad, funcionamiento y navegación por el Sitio \nWeb.</p><p>En el momento en que se obtengan los datos personales, se \ninformará al Usuario acerca del fin o fines específicos del tratamiento a\n que se destinarán los datos personales; es decir, del uso o usos que se\n dará a la información recopilada.</p><p>Períodos de retención de los datos personales</p><p>Los\n datos personales solo serán retenidos durante el tiempo mínimo \nnecesario para los fines de su tratamiento y, en todo caso, únicamente \ndurante el siguiente plazo: 6 meses, o hasta que el Usuario solicite su \nsupresión.</p><p>En el momento en que se obtengan los datos personales, \nse informará al Usuario acerca del plazo durante el cual se conservarán \nlos datos personales o, cuando eso no sea posible, los criterios \nutilizados para determinar este plazo.</p><p>Destinatarios de los datos personales</p><p>Los datos personales del Usuario no serán compartidos con terceros.</p><p>En\n cualquier caso, en el momento en que se obtengan los datos personales, \nse informará al Usuario acerca de los destinatarios o las categorías de \ndestinatarios de los datos personales.</p><p>Datos personales de menores de edad</p><p>Respetando\n lo establecido en los artículos 8 del RGPD y 13 del RDLOPD, solo los \nmayores de 14 años podrán otorgar su consentimiento para el tratamiento \nde sus datos personales de forma lícita por Cita previa Guadalinfo. Si \nse trata de un menor de 14 años, será necesario el consentimiento de los\n padres o tutores para el tratamiento, y este solo se considerará lícito\n en la medida en la que los mismos lo hayan autorizado.</p><p>Secreto y seguridad de los datos personales</p><p>Cita\n previa Guadalinfo se compromete a adoptar las medidas técnicas y \norganizativas necesarias, según el nivel de seguridad adecuado al riesgo\n de los datos recogidos, de forma que se garantice la seguridad de los \ndatos de carácter personal y se evite la destrucción, pérdida o \nalteración accidental o ilícita de datos personales transmitidos, \nconservados o tratados de otra forma, o la comunicación o acceso no \nautorizados a dichos datos.</p><p>El Sitio Web cuenta con un certificado\n SSL (Secure Socket Layer), que asegura que los datos personales se \ntransmiten de forma segura y confidencial, al ser la transmisión de los \ndatos entre el servidor y el Usuario, y en retroalimentación, totalmente\n cifrada o encriptada.</p><p>Sin embargo, debido a que Cita previa \nGuadalinfo no puede garantizar la inexpugnabilidad de internet ni la \nausencia total de hackers u otros que accedan de modo fraudulento a los \ndatos personales, el Responsable del tratamiento se compromete a \ncomunicar al Usuario sin dilación indebida cuando ocurra una violación \nde la seguridad de los datos personales que sea probable que entrañe un \nalto riesgo para los derechos y libertades de las personas físicas. \nSiguiendo lo establecido en el artículo 4 del RGPD, se entiende por \nviolación de la seguridad de los datos personales toda violación de la \nseguridad que ocasione la destrucción, pérdida o alteración accidental o\n ilícita de datos personales transmitidos, conservados o tratados de \notra forma, o la comunicación o acceso no autorizados a dichos datos.</p><p>Los\n datos personales serán tratados como confidenciales por el Responsable \ndel tratamiento, quien se compromete a informar de y a garantizar por \nmedio de una obligación legal o contractual que dicha confidencialidad \nsea respetada por sus empleados, asociados, y toda persona a la cual le \nhaga accesible la información.</p><p>Derechos derivados del tratamiento de los datos personales</p><p>El\n Usuario tiene sobre Cita previa Guadalinfo y podrá, por tanto, ejercer \nfrente al Responsable del tratamiento los siguientes derechos \nreconocidos en el RGPD:</p><p>Derecho de acceso: Es el derecho del \nUsuario a obtener confirmación de si Cita previa Guadalinfo está \ntratando o no sus datos personales y, en caso afirmativo, obtener \ninformación sobre sus datos concretos de carácter personal y del \ntratamiento que Cita previa Guadalinfo haya realizado o realice, así \ncomo, entre otra, de la información disponible sobre el origen de dichos\n datos y los destinatarios de las comunicaciones realizadas o previstas \nde los mismos.</p><p>Derecho de rectificación: Es el derecho del Usuario\n a que se modifiquen sus datos personales que resulten ser inexactos o, \nteniendo en cuenta los fines del tratamiento, incompletos.</p><p>Derecho\n de supresión (\"el derecho al olvido\"): Es el derecho del Usuario, \nsiempre que la legislación vigente no establezca lo contrario, a obtener\n la supresión de sus datos personales cuando estos ya no sean necesarios\n para los fines para los cuales fueron recogidos o tratados; el Usuario \nhaya retirado su consentimiento al tratamiento y este no cuente con otra\n base legal; el Usuario se oponga al tratamiento y no exista otro motivo\n legítimo para continuar con el mismo; los datos personales hayan sido \ntratados ilícitamente; los datos personales deban suprimirse en \ncumplimiento de una obligación legal; o los datos personales hayan sido \nobtenidos producto de una oferta directa de servicios de la sociedad de \nla información a un menor de 14 años. Además de suprimir los datos, el \nResponsable del tratamiento, teniendo en cuenta la tecnología disponible\n y el coste de su aplicación, deberá adoptar medidas razonables para \ninformar a los responsables que estén tratando los datos personales de \nla solicitud del interesado de supresión de cualquier enlace a esos \ndatos personales.</p><p>Derecho a la limitación del tratamiento: Es el \nderecho del Usuario a limitar el tratamiento de sus datos personales. El\n Usuario tiene derecho a obtener la limitación del tratamiento cuando \nimpugne la exactitud de sus datos personales; el tratamiento sea \nilícito; el Responsable del tratamiento ya no necesite los datos \npersonales, pero el Usuario lo necesite para hacer reclamaciones; y \ncuando el Usuario se haya opuesto al tratamiento.</p><p>Derecho a la \nportabilidad de los datos: En caso de que el tratamiento se efectúe por \nmedios automatizados, el Usuario tendrá derecho a recibir del \nResponsable del tratamiento sus datos personales en un formato \nestructurado, de uso común y lectura mecánica, y a transmitirlos a otro \nresponsable del tratamiento. Siempre que sea técnicamente posible, el \nResponsable del tratamiento transmitirá directamente los datos a ese \notro responsable.</p><p>Derecho de oposición: Es el derecho del Usuario a\n que no se lleve a cabo el tratamiento de sus datos de carácter personal\n o se cese el tratamiento de los mismos por parte de Cita previa \nGuadalinfo.</p><p>Derecho a no ser a no ser objeto de una decisión \nbasada únicamente en el tratamiento automatizado, incluida la \nelaboración de perfiles: Es el derecho del Usuario a no ser objeto de \nuna decisión individualizada basada únicamente en el tratamiento \nautomatizado de sus datos personales, incluida la elaboración de \nperfiles, existente salvo que la legislación vigente establezca lo \ncontrario.</p><p>Así pues, el Usuario podrá ejercitar sus derechos \nmediante comunicación escrita dirigida al Responsable del tratamiento \ncon la referencia \"RGPD-decitas.zafarraya.es\", especificando:</p><p>Nombre,\n apellidos del Usuario y copia del DNI. En los casos en que se admita la\n representación, será también necesaria la identificación por el mismo \nmedio de la persona que representa al Usuario, así como el documento \nacreditativo de la representación. La fotocopia del DNI podrá ser \nsustituida, por cualquier otro medio válido en derecho que acredite la \nidentidad.</p><p>Petición con los motivos específicos de la solicitud o información a la que se quiere acceder.</p><p>Domicilio a efecto de notificaciones.</p><p>Fecha y firma del solicitante.</p><p>Todo documento que acredite la petición que formula.</p><p>Esta solicitud y todo otro documento adjunto podrá enviarse a la siguiente dirección y/o correo electrónico:</p><p>Dirección postal:</p><p>C/ Entrada de Granada, 5</p><p>18128 Zafarraya</p><p>GRANADA</p><p>Correo electrónico: informatica@zafarraya.es</p><p>Enlaces a sitios web de terceros</p><p>El\n Sitio Web puede incluir hipervínculos o enlaces que permiten acceder a \npáginas web de terceros distintos de Cita previa Guadalinfo, y que por \ntanto no son operados por Cita previa Guadalinfo. Los titulares de \ndichos sitios web dispondrán de sus propias políticas de protección de \ndatos, siendo ellos mismos, en cada caso, responsables de sus propios \nficheros y de sus propias prácticas de privacidad.</p><p>Reclamaciones ante la autoridad de control</p><p>En\n caso de que el Usuario considere que existe un problema o infracción de\n la normativa vigente en la forma en la que se están tratando sus datos \npersonales, tendrá derecho a la tutela judicial efectiva y a presentar \nuna reclamación ante una autoridad de control, en particular, en el \nEstado en el que tenga su residencia habitual, lugar de trabajo o lugar \nde la supuesta infracción. En el caso de España, la autoridad de control\n es la Agencia Española de Protección de Datos (http://www.agpd.es).</p><p>Aceptación y cambios en esta política de privacidad</p><p>Es\n necesario que el Usuario haya leído y esté conforme con las condiciones\n sobre la protección de datos de carácter personal contenidas en esta \nPolítica de Privacidad, así como que acepte el tratamiento de sus datos \npersonales para que el Responsable del tratamiento pueda proceder al \nmismo en la forma, durante los plazos y para las finalidades indicadas. \nEl uso del Sitio Web implicará la aceptación de la Política de \nPrivacidad del mismo.</p><p>Cita previa Guadalinfo se reserva el derecho\n a modificar su Política de Privacidad, de acuerdo a su propio criterio,\n o motivado por un cambio legislativo, jurisprudencial o doctrinal de la\n Agencia Española de Protección de Datos. Los cambios o actualizaciones \nde esta Política de Privacidad no serán notificados de forma explícita \nal Usuario. Se recomienda al Usuario consultar esta página de forma \nperiódica para estar al tanto de los últimos cambios o actualizaciones.</p><p>Esta\n Política de Privacidad fue actualizada el día 19 de mayo 2020 para \nadaptarse al Reglamento (UE) 2016/679 del Parlamento Europeo y del \nConsejo, de 27 de abril de 2016, relativo a la protección de las \npersonas físicas en lo que respecta al tratamiento de datos personales y\n a la libre circulación de estos datos (RGPD) y a la Ley Orgánica \n3/2018, de 5 de diciembre, de Protección de Datos Personales y garantía \nde los derechos digitales (LOPD)</p><p>V. POLÍTICA DE COOKIES</p><p>El \nacceso a este Sitio Web puede implicar la utilización de cookies. Las \ncookies son pequeñas cantidades de información que se almacenan en el \nnavegador utilizado por cada Usuario —en los distintos dispositivos que \npueda utilizar para navegar— para que el servidor recuerde cierta \ninformación que posteriormente y únicamente el servidor que la \nimplementó leerá. Las cookies facilitan la navegación, la hacen más \namigable, y no dañan el dispositivo de navegación.</p><p>La información \nrecabada a través de las cookies puede incluir la fecha y hora de \nvisitas al Sitio Web, las páginas visionadas, el tiempo que ha estado en\n el Sitio Web y los sitios visitados justo antes y después del mismo. \nSin embargo, ninguna cookie permite que esta misma pueda contactarse con\n el número de teléfono del Usuario o con cualquier otro medio de \ncontacto personal. Ninguna cookie puede extraer información del disco \nduro del Usuario o robar información personal. La única manera de que la\n información privada del Usuario forme parte del archivo Cookie es que \nel usuario dé personalmente esa información al servidor.</p><p>Las \ncookies que permiten identificar a una persona se consideran datos \npersonales. Por tanto, a las mismas les será de aplicación la Política \nde Privacidad anteriormente descrita. En este sentido, para la \nutilización de las mismas será necesario el consentimiento del Usuario. \nEste consentimiento será comunicado, en base a una elección auténtica, \nofrecido mediante una decisión afirmativa y positiva, antes del \ntratamiento inicial, removible y documentado.</p><p>Cookies propias</p><p>Son\n aquellas cookies que son enviadas al ordenador o dispositivo del \nUsuario y gestionadas exclusivamente por Cita previa Guadalinfo para el \nmejor funcionamiento del Sitio Web. La información que se recaba se \nemplea para mejorar la calidad del Sitio Web y su Contenido y su \nexperiencia como Usuario. Estas cookies permiten reconocer al Usuario \ncomo visitante recurrente del Sitio Web y adaptar el contenido para \nofrecerle contenidos que se ajusten a sus preferencias.</p><p>La(s) \nentidad(es) encargada(s) del suministro de cookies podrá(n) ceder esta \ninformación a terceros, siempre y cuando lo exija la ley o sea un \ntercero el que procese esta información para dichas entidades.</p><p>Deshabilitar, rechazar y eliminar cookies</p><p>El\n Usuario puede deshabilitar, rechazar y eliminar las cookies —total o \nparcialmente— instaladas en su dispositivo mediante la configuración de \nsu navegador (entre los que se encuentran, por ejemplo, Chrome, Firefox,\n Safari, Explorer). En este sentido, los procedimientos para rechazar y \neliminar las cookies pueden diferir de un navegador de Internet a otro. \nEn consecuencia, el Usuario debe acudir a las instrucciones facilitadas \npor el propio navegador de Internet que esté utilizando. En el supuesto \nde que rechace el uso de cookies —total o parcialmente— podrá seguir \nusando el Sitio Web, si bien podrá tener limitada la utilización de \nalgunas de las prestaciones del mismo.</p><p>Cambios en la Política de Cookies</p><p>Es\n posible que la Política de Cookies del Sitio Web cambie o se actualice,\n por ello es recomendable que el Usuario revise esta política cada vez \nque acceda al Sitio Web con el objetivo de estar adecuadamente informado\n sobre cómo y para qué usamos las cookies.</p><p>VI. POLÍTICA DE ENLACES</p><p>Se\n informa que el Sitio Web de Cita previa Guadalinfo pone o puede poner a\n disposición de los Usuarios medios de enlace (como, entre otros, links,\n banners, botones), directorios y motores de búsqueda que permiten a los\n Usuarios acceder a sitios web pertenecientes y/o gestionados por \nterceros.</p><p>La instalación de estos enlaces, directorios y motores \nde búsqueda en el Sitio Web tiene por objeto facilitar a los Usuarios la\n búsqueda de y acceso a la información disponible en Internet, sin que \npueda considerarse una sugerencia, recomendación o invitación para la \nvisita de los mismos.</p><p>Cita previa Guadalinfo no ofrece ni \ncomercializa por sí ni por medio de terceros los productos y/o servicios\n disponibles en dichos sitios enlazados.</p><p>Asimismo, tampoco \ngarantizará la disponibilidad técnica, exactitud, veracidad, validez o \nlegalidad de sitios ajenos a su propiedad a los que se pueda acceder por\n medio de los enlaces.</p><p>Cita previa Guadalinfo en ningún caso \nrevisará o controlará el contenido de otros sitios web, así como tampoco\n aprueba, examina ni hace propios los productos y servicios, contenidos,\n archivos y cualquier otro material existente en los referidos sitios \nenlazados.</p><p>Cita previa Guadalinfo no asume ninguna responsabilidad\n por los daños y perjuicios que pudieran producirse por el acceso, uso, \ncalidad o licitud de los contenidos, comunicaciones, opiniones, \nproductos y servicios de los sitios web no gestionados por Cita previa \nGuadalinfo y que sean enlazados en este Sitio Web.</p><p>El Usuario o \ntercero que realice un hipervínculo desde una página web de otro, \ndistinto, Sitio Web al Sitio Web de Cita previa Guadalinfo deberá saber \nque:</p><p>Se permite la reproducción —total o parcialmente— de los \nContenidos y/o Servicios del Sitio Web en base a una licencia Creative \nCommons (https://creativecommons.org/licenses/by/4.0/legalcode.es) y el \ncódigo está sujeto a una licencia GPL V3.0 pudiéndose consultar en sus \ntérminos en la web de su autor original: \nhttps://easyappointments.org/docs.html#1.3.2/readme.md.</p><p>No se \npermite ninguna manifestación falsa, inexacta o incorrecta sobre el \nSitio Web de Cita previa Guadalinfo, ni sobre los Contenidos y/o \nServicios del mismo.</p><p>A excepción del hipervínculo, el Sitio Web en\n el que se establezca dicho hiperenlace no contendrá ningún elemento, de\n este Sitio Web, protegido como propiedad intelectual por el \nordenamiento jurídico español, salvo autorización expresa de Cita previa\n Guadalinfo y/o los términos de la correspondiente licencia.</p><p>El \nestablecimiento del hipervínculo no implicará la existencia de \nrelaciones entre Cita previa Guadalinfo y el titular del Sitio Web desde\n el cual se realice, ni el conocimiento y aceptación de Cita previa \nGuadalinfo de los contenidos, servicios y/o actividades ofrecidos en \ndicho Sitio Web, y viceversa.</p><p>VII. PROPIEDAD INTELECTUAL E INDUSTRIAL</p><p>Cita\n previa Guadalinfo por sí o como parte cesionaria, es titular de todos \nlos derechos de propiedad intelectual e industrial del Sitio Web, así \ncomo de los elementos contenidos en el mismo (a título enunciativo y no \nexhaustivo, imágenes, sonido, audio, vídeo, software o textos, marcas o \nlogotipos, combinaciones de colores, estructura y diseño, selección de \nmateriales usados, programas de ordenador necesarios para su \nfuncionamiento, acceso y uso, etc.) no amparados en las licencias de \nsoftware y código libre mencionadas con anterioridad. Serán, por \nconsiguiente, obras protegidas como propiedad intelectual por el \nordenamiento jurídico español, siéndoles aplicables tanto la normativa \nespañola y comunitaria en este campo, como los tratados internacionales \nrelativos a la materia y suscritos por España.</p><p>El resto de \nderechos están reservados. En virtud de lo dispuesto en la Ley de \nPropiedad Intelectual, quedan expresamente prohibidas la reproducción, \nla distribución y la comunicación pública, incluida su modalidad de \npuesta a disposición, de la totalidad o parte de los contenidos de esta \npágina web, con fines comerciales, en cualquier soporte y por cualquier \nmedio técnico, sin la autorización de Cita previa Guadalinfo.</p><p>En \ncaso de que el Usuario o tercero considere que cualquiera de los \nContenidos del Sitio Web suponga una violación de los derechos de \nprotección de la propiedad intelectual, deberá comunicarlo \ninmediatamente a Cita previa Guadalinfo a través de los datos de \ncontacto del apartado de INFORMACIÓN GENERAL de este Aviso Legal y \nCondiciones Generales de Uso.</p><p>VIII. ACCIONES LEGALES, LEGISLACIÓN APLICABLE Y JURISDICCIÓN</p><p>Cita\n previa Guadalinfo se reserva la facultad de presentar las acciones \nciviles o penales que considere necesarias por la utilización indebida \ndel Sitio Web y Contenidos, o por el incumplimiento de las presentes \nCondiciones.</p><p>La relación entre el Usuario y Cita previa Guadalinfo\n se regirá por la normativa vigente y de aplicación en el territorio \nespañol. De surgir cualquier controversia en relación a la \ninterpretación y/o a la aplicación de estas Condiciones las partes \nsometerán sus conflictos a la jurisdicción ordinaria sometiéndose a los \njueces y tribunales que correspondan conforme a derecho.</p><p>Ultima modificación: 19 de mayo 2020</p>'),(12,'display_privacy_policy','0'),(13,'privacy_policy_content','----<br>'),(14,'company_name','Ayto. de Zafarraya - Centro Guadalinfo'),(15,'company_email','guadalinfo.zafarraya@guadalinfo.es'),(16,'company_link','https://www.zafarraya.es');
